create table facturas_venta (
	num_factura VARCHAR(20) PRIMARY KEY,
	id_obra VARCHAR(8) NOT NULL,
	cif_cliente VARCHAR(9) NOT NULL,
	concepto VARCHAR(24),
	base_imponible DECIMAL(8,2) NOT NULL,
	iva DECIMAL(7,2) NOT NULL,
	año INT NOT NULL,
	fecha DATE NOT NULL,
	fecha_cobro DATE,
	FOREIGN KEY (cif_cliente) REFERENCES clientes(cif),
	FOREIGN KEY (id_obra) REFERENCES obras(id)
);
